  true,\n\t\"url\": null,\n\t\"notes\": \"This Sixth Tranche Report to Congress meets
  the requirement for reporting at the $350 billion commitment level under section
  105(b) of the Emergency Economic Stabilization Act of 2008 (EESA).  Recent transactions
  under the Auto Supplier Support Program, Consumer and Business Lending Initiative,
  Home Affordable Modification Program, and Systemically Significant Failing Institutions
  Program, when combined with $3.6 billion of transactions under the Capital Purchase
  Program, bring the total investment amount to $376.7 billion as April 17, 2009.
  Treasury will submit the next report when transactions reach the $400 billion level.rnrnThe
  Report addresses the following six areas:rnrnu2022   A description of all the transactions
  made during the reporting period.rnu2022   A description of the pricing mechanism
  for the transactions.rnu2022   A justification of the price paid for, and other
  financial terms associated with, the rntransactions.rnu2022   A description of the
  impact of the exercise of such authority on the financial system.rnu2022   A description
  of the challenges that remain in the financial system, including any benchmarks
  rnyet to be achieved.rnu2022   An estimate of additional actions under the authority
  provided pursuant to the EESA that may be rnnecessary to address such challenges.\",\n\t\"license_title\":
